import { NavLink } from 'react-router-dom';

const NavBar = () => {
  return (
    <>
      <ul className="navbar">
        <li>
          <NavLink className="abc" to="/">
            Home
          </NavLink>
        </li>
        <li>
          <NavLink to="/about">About</NavLink>
        </li>
        <li>
          <NavLink to="/contact">Contact</NavLink>
        </li>
      </ul>
    </>
  );
};

export default NavBar;

